import Layout from "../components/Layout"

class HomePage extends React.Component{
  constructor(props){
    super(props)
  }

  render(){
    return (
      <Layout style={{ textAlign: ''}}>
        <h1>JDanielS</h1>
        <p>Professional Idiot</p>
      </Layout>
    )
  }
}

export default HomePage
